// Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import BentoBoxes from '../components/BentoBoxes';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Home = () => {
    return (
        <div className="dark:bg-theme-dark-background text-theme-light-text dark:text-theme-dark-text h-screen w-full overflow-hidden flex flex-col justify-between">
            <div className="flex justify-between items-center pt-12 pl-12 pr-12">
                <div className="text-4xl font-bold">Home</div>
                <Button variant="contained" color="primary">Settings</Button>
            </div>
            <div className='p-12 flex-grow'>
                <BentoBoxes />
            </div>
            <div className="flex items-center p-12">
                <Button variant="contained" color="primary">Speech to Text</Button>
                <div className="flex-grow"></div> {/* This ensures the search bar is centered */}
                <TextField label="Search" variant="outlined" style={{ width: '33%' }} />
                <div className="flex-grow"></div> {/* This ensures the search bar is centered */}
            </div>
        </div>
    );
};

export default Home;
